import { useEffect, useState } from "react"

const EXCHANGE_LIST = ['okx', 'bybit', 'bitmex']

function getDataFromApi() {
  const parsedData = {}
  for (let exchange of EXCHANGE_LIST){
    fetch("http://139.59.154.21:8080/fundingRank?cex=" + exchange)
        .then(response => response.json())
        .then(json => 
          parsedData[exchange] = json
        )
        /*.finally(() => 
          {
            console.log(parsedData)
          }
          //setLoading(false)
        )*/
  }

  return parsedData
}

function FundingRankTable() {
  const [fundingRank, setFundingRank] = useState([])
  const [loading, setLoading] = useState(false)
  useEffect(() => {
    setLoading(true)
    const fundingRank = getDataFromApi()
    console.log(fundingRank)
    setFundingRank(fundingRank)
    setLoading(false)
  }, [])

  return (
    <div className="FundingRankTable">
      {loading ? (
        <div>Loading...</div>
      ) : (
        <>
          <h1>exchange</h1>
          {
          fundingRank.map(exchange => (
              <table border={1} key={exchange}>
                <tr>
                  <th>Pair</th>
                  <th>Funding</th>
                </tr>
                  <tr key={exchange}>
                    <td>{fundingRank.exchange.pair}</td>
                    <td>{fundingRank.exchange.funding}</td>
                  </tr>
              </table>
            ))}
        </>
      )}
    </div>
  )
}

function FundingRankTableBybit() {
  const [users, setUsers] = useState([])
  const [loading, setLoading] = useState(false)
  useEffect(() => {
    setLoading(true)
    fetch("http://139.59.154.21:8080/fundingRank?cex=Bybit")
      .then(response => response.json())
      .then(json => setUsers(json))
      .finally(() => {
        setLoading(false)
      })
  }, [])

  return (
    <div className="FundingRankTableBybit">
      {loading ? (
        <div>Loading...</div>
      ) : (
        <>
          <h1>Bybit</h1>
          <table border={1}>
            <tr>
              <th>Pair</th>
              <th>Funding</th>
            </tr>
            {users.map(user => (
              <tr key={user.id}>
                <td>{user.pair}</td>
                <td>{user.funding}</td>
              </tr>
            ))}
          </table>
        </>
      )}
    </div>
  )
}



export default FundingRankTable;
